  const handleSubmit = (e) => {
    e.preventDefault();
    const data = new FormData(e.target);
  };
  return (
    <div className="app">
      <form onSubmit={handleSubmit}>
        <Form name="name" placeholder="Name" />
        <Form placeholder="Email" />
        <Form placeholder="Phone No." />
        <Form placeholder="Access Code" />
        <button>Validate to Start</button>
      </form>
    </div>
  );
}

export default App;
